<h2 style="margin: 0">3</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Prominent features of management strategies in acute coronary syndromes with the new oral antiplatelet agents ] . The novel oral 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9H244

</mark>
 inhibitors ( prasugrel and ticagrelor ) have been incorporated into the recently updated acute coronary syndrome ( ACS ) guidelines , as an adjunct antiplatelet treatment to aspirin . The studies involving the use of new oral antiplatelet agents that are more potent , predictable and faster platelet inhibitors than clopidogrel have demonstrated superiority with respect to the primary composite endpoint ( cardiovascular death , non-lethal myocardial infarction , stroke ) for both prasugrel and ticagrelor compared to clopidogrel . The subgroup analysis of the relevant studies showed that these new agents differ in their level of efficacy in different ACS patient subgroups : ( 1 ) Mortality was reduced with ticagrelor ; ( 2 ) 
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB08816

</mark>
 is especially more effective in intermediate-and high-risk non-ST elevation ACS patients in whom early invasive strategy is selected ; ( 3 ) Prasugrel should be especially preferred in patients with acute ST elevation myocardial infarction undergoing percutaneous coronary intervention ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05154
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) after diagnostic angiography ; and ( 4 ) Prasugrel is more effective in diabetic patients . While clopidogrel is recommended for ACS patients who are followed with a non-invasive strategy or who have not undergone percutaneous revascularization , it is the last line choice or an alternative to the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 inhibitor therapy for patients undergoing invasive strategy .</div>

<h2 style="margin: 0">4</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #003300, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 reduces neutrophil recruitment and lung damage in abdominal sepsis . Abstract Platelets play an important role in abdominal sepsis and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 receptor antagonists have been reported to exert anti-inflammatory effects . Herein , we assessed the impact of platelet inhibition with the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9H244
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 receptor antagonist ticagrelor on pulmonary neutrophil recruitment and tissue damage in a model of abdominal sepsis . Wild-type C57BL / 6 mice were subjected to cecal ligation and puncture ( CLP ) . Animals were treated with ticagrelor ( 100 mg / kg ) or vehicle prior to CLP induction . Edema formation and bronchoalveolar neutrophils as well as lung damage were quantified . Flow cytometry was used to determine expression of platelet-neutrophil aggregates , neutrophil activation and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 expression on platelets . CLP-induced pulmonary infiltration of neutrophils at 24 hours was reduced by 50 % in ticagrelor-treated animals . Moreover , ticagrelor abolished CLP-provoked lung edema and decreased lung damage score by 41 % . Notably , ticagrelor completely inhibited formation of platelet-neutrophil aggregates and markedly reduced thrombocytopenia in CLP animals . In addition , ticagrelor reduced platelet shedding of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 in septic mice . Our data indicate that ticagrelor can reduce CLP-induced pulmonary neutrophil recruitment and lung damage suggesting a potential role for platelet antagonists , such as ticagrelor , in the management of patients with abdominal sepsis .</div>

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The anti -

 primatized monoclonal antibody , galiximab , is well-tolerated but has limited activity in relapsed Hodgkin lymphoma : Cancer and Leukemia Group B 50602 ( Alliance ) . Relapsed Hodgkin lymphoma remains a clinical challenge , with few non-cytotoxic treatment options . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 is a surface antigen that normally functions as a co-stimulatory molecule but is aberrantly and uniformly expressed on Reed-Sternberg cells . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB04901
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is a primatized monoclonal antibody against 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P33681
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 inhibits platelets in a reversible manner and does not require hepatic bioactivation . The pharmacology of ticagrelor indicates that it provides more consistent , more rapid and more potent platelet inhibition than clopidogrel . Preclinical and clinical studies with ticagrelor have demonstrated that this drug has excellent oral bioavailability . The Phase III clinical study of Platelet Inhibition and Patient Outcomes ( PLATO ) has shown that ticagrelor reduced ischemic events and all-cause mortality without an increase in major bleeding complications . Potential advantages of ticagrelor include more flexibility in its use if rapid onset of action is needed before percutaneous coronary interventions or when cessation is required before coronary artery bypass graft surgery . Potential disadvantages include more side effects such as dyspnea , ventricular pauses or an increase in concentrations of uric acid and creatinine . However , ticagrelor did not only reduce death due to vascular causes but also all-cause mortality . Further clinical trials in indications other than acute coronary syndrome are awaited .</div>
